import './App.css';
import ChatBot from './ChatBot';
import Header from './Header';
import Home from './Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Menu from './Menu';
import FormsList from './FormsList';
import { React, useState } from 'react';
// import OCR from './OCR';
import './OCR.css';
import MarkTemp from './MarkTemp';
// import Login from './Login';
// import Signup from './Signup';
import ViewUsers from './ViewUsers';
// import Logout from './Logout';
import PrevTemplates from './PrevTemplates';
import ShowTemplate from './ShowTemplate';
import ShowData from './ShowData';
import GetData from './GetData';
import PersistentDrawerLeft from './PersistentDrawerLeft';
import ViewData from './ViewData';

function App() {
  const [loggedin, setLoggedin] = useState(localStorage.getItem("username"));
  let dict = {};
    if(loggedin==null){
      dict['Signup/Login']='/login';
    }
    else{
      console.log("ADad");
      dict['Mark Template']='/marktemp';
      dict['Get Data']='/getdata';
      dict['Previous Templates']='/prevtemplates';
      if(loggedin==="admin")
        dict['View Users'] = '/users';
      dict['Logout']='/logout';
    }
  return (
    <div>
      {/* <OCR/> */}
      <Router>
        <Routes>
          {/* <Route exact path='/' component={Login} /> */}
          {/* <Route exact path='/marktemp' element={<React.Fragment>
            <PersistentDrawerLeft />
            <MarkTemp />
          </React.Fragment>}>
          </Route> */}
          {/* <Route exact path='/login' component={Login} /> */}
          {/* <Route exact path='/signup' component={Signup} /> */}
          {/* <Route exact path='/users' element={<React.Fragment>
            <PersistentDrawerLeft />
            <ViewUsers />
          </React.Fragment>}>
          </Route> */}
          {/* <Route exact path='/logout' component={Logout} /> */}
          {/* <Route exact path='/prevtemplates' element={<React.Fragment>
            <PersistentDrawerLeft />
            <PrevTemplates />
          </React.Fragment>}>
          </Route> */}
          {/* <Route exact path='/template/:tid' element={<React.Fragment>
            <PersistentDrawerLeft />
            <ShowTemplate />
          </React.Fragment>}>
          </Route> */}
          {/* <Route exact path='/data/:tid' element={<React.Fragment>
            <PersistentDrawerLeft />
            <ShowData />
          </React.Fragment>}>
          </Route> */}
          {/* <Route exact path='/getdata' element={<React.Fragment>
            <PersistentDrawerLeft />
            <GetData />
          </React.Fragment>}>
          </Route> */}
          {/* <Route exact path='/viewdata/:tid/:did' element={<React.Fragment>
            <PersistentDrawerLeft />
            <ViewData />
          </React.Fragment>}>
          </Route> */}
          {/* <Route exact path='/ocr' Component={OCR} /> */}
          <Route exact path='/formsList' element={<React.Fragment>
            <Header />
            <FormsList />
          </React.Fragment>}>
          </Route>
          <Route exact path='/menu' element={<React.Fragment>
            <Header />
            <Menu />
          </React.Fragment>}>
          </Route>
          <Route exact path='/chatBot' element={<React.Fragment>
            <Header />
            <ChatBot />
          </React.Fragment>}>
          </Route>
          <Route exact path='/' element={Home}>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
